it = iter(map(int, sys.stdin.read().split()))
t = next(it)
out_lines = []
for _ in range(t):
    n, m = next(it), next(it)
    A = [[next(it) for _ in range(m)] for _ in range(n)]
    C = [[0]*n for _ in range(n)]
    for i in range(n):
        for j in range(i, n):
